import React, { Component } from 'react'
import { BoxContainer, SubmitCon, Submit_btn, Submit_Coninp, Submit_inp, Submit_text, Submit_text1, Submit_text2 } from './Submit'

export default class Submit extends Component {
    render() {
        return (
            <SubmitCon>
                <Submit_text>
                    <Submit_text1>Subscribe Our Newsletter</Submit_text1>
                    <Submit_text2> Lorem ipsum dolor sit amet, consectetur adipisicing elit. Rem, voluptate odio! Ipsum itaque rem impedit sunt! Nulla ea consequuntur tempora! 
                    </Submit_text2>
                    <Submit_Coninp> <Submit_inp placeholder='Enter...' />  </Submit_Coninp>
                </Submit_text>
                <BoxContainer>
                    <BoxContainer.Text></BoxContainer.Text>
                </BoxContainer>
            </SubmitCon>
        )
    }
}
